const ServiceHero = () => {
    return ( 
       <div className="services-section">
           <div className="container">
           <div className="card-heading">
                 <h4>Our Services</h4>
             </div>
             <div className="row">
                 <div className="col-md-3">
                     <div className="service-content">
                         <img src="/s-1.png" className="img-fluid"/>
                         <h4>Nesciunt Mete</h4>
                     </div>
                 </div>
             </div>
           </div>
       </div>
     );
}
 
export default ServiceHero;
